(function(){
	var domains = {
		"https:" : "https://f2e.ws.netease.com",
		"http:" : "http://img1.cache.netease.com/"
	};
	var _F2E_CONFIG = window._F2E_CONFIG || {};
	var consts = _F2E_CONFIG.consts || {};
	var urlConfig = consts.qrcode || {};
		urlConfig.qrcode = domains[location.protocol] + "/f2e/component/qrcode/qrcode.598962.min.js";	
	neAutoQcode(urlConfig);
})();

function neAutoQcode(urlConfig){
	var logo = getLogoInfo().base64;
	var res = urlConfig.qrcode;

	var hash = urlConfig.hash || true;
	var queryString = urlConfig.queryString || true;

	var link = location.href;
		link = urlAdopter(hash,queryString);

	var sizes = [256,60,2];

	var _body = document.getElementsByTagName("body")[0];
	var node = document.createElement("div");
	var canvas = document.createElement("canvas");
		canvas.style.cssText = "position:fixed;right:30px;top:80px;z-index:10000;";
		canvas.width = sizes[0] + sizes[2]*2;
		canvas.height = sizes[0] + sizes[2]*2;
		canvas.title = "点击关闭";
	var context = canvas.getContext("2d");

	var script = document.createElement("script");  
		script.src = res;
	_body.appendChild(script);

	var loadLogo = new Image();
		loadLogo.src = logo;

	var step = 0;
	loadLogo.onload = function(){
		step += 1;
		if(step == 2){
			new QRCode(node, link.toString());
			setTimeout(draw,200);
		}
	}
	script.onload = function(){
		step += 1;
		if(step == 2){
			new QRCode(node, link.toString());
			setTimeout(draw,200);
		}
	}

	function draw(){
		var qcodeOrg = node.getElementsByTagName("img")[0].src;

		var logoLength = sizes[1];
		var logoX = sizes[0]/2 - logoLength/2 + sizes[2];

		fillrect(0,sizes[0]*2);
		drawImg(qcodeOrg,{x:sizes[2],y:sizes[2]},sizes[0]);
		fillrect(logoX,logoLength);
		drawImg(logo,{x:logoX,y:logoX},logoLength);
		_body.appendChild(canvas);
		canvas.onclick = function(){
			_body.removeChild(canvas);
		}
	}

	function drawImg(path,pos,length){
		var img = new Image();
		img.src  = path;
		context.drawImage(img, pos.x, pos.y,length,length);
	}

	function fillrect(logoX,logoLength){
		var _l = logoLength + 6;
		var _pos = logoX - 3;
		context.fillStyle = "#ffffff";
		context.fillRect(_pos,_pos,_l,_l);
	}

	function getTrueUrl(callback){
		//getImageData,putImageData
		var imageData = context.getImageData(50, 50, 20, 20);
		NE.uploadImgData(imageData,function(data){
			callback(data.ourl);
		});
	}

	function urlAdopter(hash,queryString){
		if(!hash){
			link = link.split("#")[0];
		}
		if(!queryString){
			link = link.split("?")[0];
		}
		return link;
	}
}

function getLogoInfo(){
	return {
		"url" : "http://img0.ph.126.net/vS6aweA4R-f7LZ36RgM0wg==/1670553986877783435.png",
		"base64" : "data:image/png;base64,"
	};
}